import React, { Component } from 'react';

export default class Object extends Component {

  render() {

    return (
      <div 
        className="object"
        style={{
          left: this.props.x, 
          top: this.props.y,
          borderRadius: 100
        }}
      >

      </div>
    )
  }
}
